const PastContests = () => {
  const [pastContests, setPastContests] = useState([]);

  useEffect(() => {
    const fetchPastContests = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/contests/past');
        setPastContests(response.data);
      } catch (error) {
        console.error('Error fetching past contests:', error);
      }
    };

    fetchPastContests();
  }, []);

  return (
    <div>
      <h2>Past Contests</h2>
      <ul>
        {pastContests.map(contest => (
          <li key={contest.id}>
            <a href={contest.link} target="_blank" rel="noopener noreferrer">
              {contest.name}
            </a> - {contest.startTime.toLocaleString()}
          </li>
        ))}
      </ul>
    </div>
  );
};
